        		            "type": typ,
        		            "config": {
        		                "mandatory": false,
        		                "placeholder": "Placeholder",
        		                "label": "Label",
        		                "label_color": "primary",
        		                "position": 'unset',
        		                "type": 'text',
        		                "clearInput": false,
        		            },
