                                "height": "128"
                            },
                            "id": new Date().getTime()
                        });
                // After having modifying Object, update its state with fs base
        	    this.updateState();
        	    break;

        	case "checkbox":
                this.formsList.push(
                        {
                            "type": typ,
                            "config": {
                                "checked": false,
                                "disabled": false,
                                "color": "primary",
                                "label_color": "dark",
                                "label": "Label"
                            },
                            "id": new Date().getTime()
                        });
                // After having modifying Object, update its state with fs base
                this.updateState();
                break;

        	default:
        		break;
        }

	}

